import React from 'react';


class App extends React.Component{

    constructor(props){
        super(props)

        this.state = {
            error: null,
            users: []
        }
    }
    
    componentDidMount(){
        fetch("https://dummyjson.com/users")
        .then(res => res.json())
        .then(
            (result) => {
                this.setState({
                    users: result.users
                });
            },
            (error) => {
                this.setState({
                    error
                })
            }
        )
    }

    render(){
        const {error, users} = this.state;

        if(error){
            return <p>Error {error.message}</p>
        }
        else{
            return(
                <div className='container'>
                    <h1>Пользователи</h1>
                    <ul>
                        {users?.map(user => (
                            <li>{user.firstName}</li>
                        ))}
                    </ul>
                </div>
            )
        }
    }
}

export default App
